How to obtain a table results from mongodb query<p>I'm tring to map some results from mongo db into a table for generate an Excel report. My Java code generates the report from a List&lt;Map&lt;String, Object&gt;&gt; where Object can be number, string date or boolean.</p>
<p>On Mongo I was able to obtain the results as I need with this command:</p>
<pre><code>db.collection.find(query,projection).map(function).flat();
</code></pre>
<p>But when I tried to replicate this command on Java I found that the eval comand was deprecated and that is not possible to execute javascript from Java Driver.
I would like to execute the mapping on database instead of mapping in my JAVA class. And I would like to execute an &quot;native query&quot; instead of using Spring Data to better manipulate my report query if needed.</p>
<p>I'm new to mongo and searching for a solution I found the aggregation pipeline, but I'm not sure that can help me.</p>
<p>Is it possible to obtain the same results with an aggregation pipeline or an other commad that can be executed with JAVA driver?</p>
<p>This is my query</p>
<pre><code>db.data_export.find({
$and: [
  { &quot;data&quot;: {$exists: true}},
  {$or: [
    {&quot;data.code1&quot;: {$exists: true}},
    {&quot;data.code2&quot;: {$exists: true}},
    {&quot;data.code3&quot;: {$exists: true}}
    ]
}, {
    companyId: 1,
    companyName: 1,
    &quot;data.code1.iterations&quot;: 1,
    &quot;data.code2.iterations&quot;:1,
    &quot;data.code3.iterations&quot;:1
}).map(function(v) {
    let maxSize = 0;
    let codes = ['code1',
        'code2',
        'code3'];
    let codeFounded = [];
    for(const [key, value] of Object.entries(v.data)) {
        if(value &amp;&amp; value.iterations){
            maxSize = Math.max(value.iterations.length, maxSize);
            codeFounded.push(key);
        }
    }
    let res = []
    for(let i=0; i&lt;maxSize;i++){
        let o = {
            companyId: v.companyId,
            companyName: v.companyName
        }
        for(let s=0; s&lt; codes.length; s++){
            const code = codes[s];
            let val = null;
            if(codeFounded.includes(code)){
                val = v.data[code].iterations[i];
            }
            o[code] = val;
        }
        res.push(o);
    }
    return res;
}).flat();
</code></pre>
