Performance of filter+sort when filtering with a range on a compound key that has a key with many increments (like millisecond timestamps)<p>Imagine that I have a Reddit-type application and I want to allow users to see posts from the last day or week or month, sorted by score (descending).</p>
<p>So let's say I have this index:</p>
<pre class="lang-js prettyprint-override"><code>db.collection(&quot;posts&quot;).createIndex({
  subreddit: 1,      // string
  creationTime: -1,  // integer (millisecond timestamp)
  score: -1,         // decimal
});
</code></pre>
<p>And the sort of query that I want to run is like this:</p>
<pre class="lang-js prettyprint-override"><code>db.collection(&quot;posts&quot;).find({
  subreddit: &quot;foo&quot;, 
  creationTime: { $gt: Date.now()-1000*60*60*24 }, // posts from last 24 hours
}).sort({ score: -1 });
</code></pre>
<p>Here's my question: Since <code>creationTime</code> has many possible values, I'm wondering whether I'd get significantly better performance (assuming ~millions of posts per subreddit) if I instead created a property like <code>creationHour</code>, which would reduce the number of values by a factor of 3600, meaning that there would be many posts <em>per</em> time increment. I don't need any more time resolution than hourly for my purposes.</p>
<p>I don't know enough about how MongoDB's indexing works, but I just have a vague intuition that the huge number of possible values of <code>creationTime</code> might make this sort of query significantly slower. On the other hand, I figure that this is quite a common sort of operation so I'd expect this sort of query to have been optimised to run efficiently either way. Hoping that a pro who understands the MongoDB's indexing can chime in to help me understand this.</p>

